INSERT INTO `wp_8_posts` VALUES (1,1,'2025-06-09 15:37:59','2025-06-09 15:37:59','<p>We\'re hoping to find ensuringopportunity.com a good home. If you\'re interested, <a href=\"mailto:sanz.andre@gmail.com\">let me know</a>.</p>\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Hi!','','publish','closed','open','','hello-world','','','2025-06-09 15:43:14','2025-06-09 15:43:14','',0,'http://ensuringopportunitycom.technologyfoc.us/?p=1',0,'post','',0),(2,1,'2025-06-09 15:37:59','2025-06-09 15:37:59','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"https://ensuringopportunitycom.technologyfoc.us/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','trash','closed','open','','sample-page__trashed','','','2025-06-09 15:41:07','2025-06-09 15:41:07','',0,'http://ensuringopportunitycom.technologyfoc.us/?page_id=2',0,